Returns true if the `Number` is an integer between zero and `u64::MAX`.

For any Number on which `is_u64` returns true, `as_u64` is guaranteed to
return the integer value.

```
# use serde_json::json;
#
let v = json!({ "a": 64, "b": -64, "c": 256.0 });

assert!(v["a"].is_u64());

